import LoginForm from '../components/LoginForm';
import { Link } from 'react-router-dom';

function Login() {
  return (
    <div className="row">
      <div className="col-12 col-sm-4 mx-auto">
        <LoginForm />
      </div>
    </div>
  );
}

export default Login;
